social_posts.post_text:
this Barbie is (not) a nature girl 🙃🤠
I went outside for 10 mins and now I’m just sniffing and sneezing 😭

things on my face (first time in a LONG time that I’ve done this lol)

complexion:
@givenchybeauty Prisme Libre Skin-Caring Glow Foundation in W370 + concealer in W310 + 4-in-1 Harmony Powder in shade 5 (Popeline Mimosa)
@bobbibrown Face Base to prime, as always w/ a little @makeupforever Pore Minimizer primer in the t-zone
@diorbeauty Backstage Face & Body Glow for some all-over illumination (pls don’t ask how old this is, I refuse to throw it away 😭)
@onesize setting mist to set (I keep this on deck, can’t live without it)

cheek:
@makeupbymario SoftSculpt Shaping Stick in Medium Dark w/ @narsissist bronzer in Punta Cana and @sephoracollection Microsmooth Powder in shade Tan mixed together for a good bronz-tour
@westmanatelier Baby Cheeks blush stick in Poppet w/ @patmcgrathreal Divine Blush in Nude Venus and @tomford Shade and Illuminate Duo in Sundrunk on top 

eyes:
@maybelline The Falsies mascara
@hudabeautyshop glitter topper from the Mercury Retrograde palette 

brows:
@patricktabeauty Major Brow Lamination Bel
@benefitcosmetics Microfilling Brow Pen in Medium Brown 

lips:
liner mix using @narsissist Dolce Vita lip pencil + @hudabeautyshop Rich Brown lip contour 2.0 lip pencil
@benefitcosmetics Benetint
@diorbeauty Rosewood Lip Oil 

#makeup #naturalblonde 🤣

one day I’ll remember to re-laminate my brows 😃 

quick product deets:

@givenchybeauty Prisme Libre foundation and concealer 
@diorbeauty Backstage Pressed Powder + Powder Blush
@narsissist Laguna Bronzer
