@patricktabeauty Brow Lamination Gel + Brow Pencil

#everydaymakeup

obsessed with what I did today, but can I do it again just like this is the question 💀

products used (in order):

@smashboxcosmetics Pore Minimizer (t-zone only)
@patricktabeauty Major Brow Lamination Gel
@narsissist Tinted Moisturizer in shade Marrakech
@givenchybeauty Prisme Libre Concealer in shade W310
@makeupbymario Shaping Stick in shade Medium Dark
@patmcgrathreal Skin Fetish concealer in LM14 (innermost part of undereye only)
@westmanatelier Baby Cheeks Blush Stick in shade Poppet
@lauramercier Translucent setting powder 
@diorbeauty Backstage Pressed Powder in shade 2N
@charlottetilbury Airbrush Bronzer in shade 3 (Tan)
@sephoracollection Microsmooth face powder in shade 40 (Tan) [will I ever not use this? the answer is no]
@romandyou Better Than Cheek blush in shades C01 and C03
@diorbeauty Rosy Glow blush in shade 001 Pink
@tomfordbeauty Shade and Illuminate Blush in shade 05 Sundrunk
•yes I use like 5 blushes, sue me!! lmao•
@patricktabeauty Major Brown Defining Pencil in Dark Brown
@guerlain Precious Light Illuminator in shade 02 to carve out the brows 
@anastasiabeverlyhills Soft Glam palette (shades Burnt Orange, Orange Soda, and Sienna)
@tomfordbeauty 32 Metallic Denim Eye Color Quad 
@yslbeauty Lash Clash Mascara
@essencemakeup Extreme Lasting Eye Pencil in shade 01 Blacklove
@onesize Setting Spray (per usual)
@narsissist Velvet Matte Lip Pencil in shade Dolce Vita
@hudabeautyshop Lip Contour 2.0 in shade Very Berry
@patmcgrathreal LUST: Gloss in shade Flesh Fantasy

full routine including brushes and tips of application will be up on @the.iris.app tonight at 10p EST! link in bio to download 🫡🫶🏽

I feel like I’m cosplaying winter because why is it sunny and warm in Michigan in December?? lol climate change gets down, he don’t play 😭

✿ makeup deets ✿ (in order of application)

@diorbeauty Airflash Spray Foundation in 4WO (I’m holding onto this and the Face & Body Glow for dear life lolol) 
@patmcgrathreal Skin Fetish foundation in Medium 21
@givenchybeauty Prisme Libre concealer in W310 
Pat McGrath Skin Fetish concealer in LM14 (undereye only for an extra pop)
@makeupbymario SoftSculpt Shaping Stick in Medium Dark
@rarebeauty Bronzer Stick in Full of Life + Melting Blush in Nearly Apricot
Dior Beauty Powder-No-Powder in 2N (highlighted areas only)
@lauramercier Translucent Powder (rest of face)
@sephoracollection Microsmooth Powder in Tan 40 (all-over transitional shade)
ctilburymakeup Airbrush Bronzer in Tan (3)
@romandyou @romand_en Better Than Cheek in shades C01 + C03 (essential. absolutely essential)
Dior Beauty Rosy Glow in 001 Pink
@patricktabeauty Monochrome Moment in She’s Adorable (doubles as a highlight!)

Final Setting Routine:

Charlotte Tilbury Setting Spray 
Dior Beauty Powder-No-Powder on highlighted areas again to set the setting spray 
finish off with @caudalie @caudalie_us Beauty Elixir 

lasts all day through sweat, tears, and humidity!

Brows:

Patrick Ta Major Brow Lamination Gel + Defining Pencil in Dark Brown

Eyes:

@anastasiabeverlyhills Soft Glam palette (shades burnt orange and orange soda)
@tomfordbeauty 32 Metallic Denim Eye Color Quad (best shimmers to ever grace the earth, I’m sorry)
@essencemakeup Extreme Lasting Eye Pencil in 01 blacklove (smudge the liner on the top; apply under your iris only on the bottom)
@yslbeauty Lash Clash mascara #yslbeauty

Lips:

@narsissist Velvet Matte Lip Pencil in Dolce Vita (overline then smudge, trust me)
@maccosmetics lip pencil in Cork (blend this into the NARS one, starting a bit further down)
Pat McGrath LUST:gloss in Flesh Fantasy

#everydaymakeup #makeupgoals #makeupinspiration #longlastingmakeup
